import { Drawer } from '@mui/material'
import React, { useContext, type ReactElement } from 'react'
import { ModalContext } from './ModalContext'
import { type ExperienceOrProject } from './ResumeContents'

export function ExperienceModal ({ experience }: { experience: ExperienceOrProject }): ReactElement | null {
  const { modalOpen, setModalOpen } = useContext(ModalContext)

  return (
    <Drawer className='sm:w-screen md:w-auto ' open={modalOpen !== null} onClose={() => { setModalOpen(null) }} anchor='right'>
        <div>
            {experience.name}
        </div>
    </Drawer>
  )
}
